import React from "react";
import { PriceListItem } from "./PriceListItem";

export function PriceCard({ title, items }) {
  return (
    <div
      className="flex relative flex-col items-center bg-white rounded-lg border border-black border-solid shadow-sm w-[312px] max-md:w-full max-md:max-w-[400px] max-sm:w-full"
    >
      <header
        className="px-4 py-0 w-full h-14 text-2xl font-bold leading-6 text-center text-white bg-red-600 rounded-lg max-md:px-3 max-md:py-0 max-md:text-xl max-sm:px-2 max-sm:py-0 max-sm:text-lg max-sm:leading-5"
      >
        {title}
      </header>
      {items.map((item, index) => (
        <PriceListItem
          key={index}
          serviceName={item.serviceName}
          price={item.price}
          isLast={index === items.length - 1}
        />
      ))}
    </div>
  );
}
